import React from 'react'
import "./Card.scss"
import {Link} from "react-router-dom"
const Card = ({item}) => {
  return (
    <Link to={`/product/${item.id}`}>

    
    <div className='card'>
        <div className="mainImg"></div>
    </div>
    </Link>

  )
}

export default Card
